import React, { useState } from 'react';

const Register = () => {
  const [isLogin, setIsLogin] = useState(true);
  const [showPopup, setShowPopup] = useState(false); // State for popup visibility

  const handleRegisterSuccess = () => {
    setShowPopup(true);
    setTimeout(() => {
      setShowPopup(false); // Hide popup after 3 seconds
      setIsLogin(true); // Switch back to login after registration
    }, 3000);
  };

  return (
    <div className="relative flex items-center justify-center min-h-screen bg-gray-100">
      <div className="w-full max-w-md px-8 py-6 bg-white shadow-lg rounded-lg">
        {/* Tabs */}
        <div className="flex justify-around mb-6 border-b-2 border-gray-200">
          <button
            onClick={() => setIsLogin(true)}
            className={`pb-2 text-xl font-semibold ${
              isLogin ? 'border-b-4 border-blue-500 text-blue-500' : 'text-gray-500'
            }`}
          >
            Login
          </button>
          <button
            onClick={() => setIsLogin(false)}
            className={`pb-2 text-xl font-semibold ${
              !isLogin ? 'border-b-4 border-blue-500 text-blue-500' : 'text-gray-500'
            }`}
          >
            Register
          </button>
        </div>

        {/* Form */}
        {isLogin ? (
          <LoginForm setIsLogin={setIsLogin} />
        ) : (
          <RegisterForm handleRegisterSuccess={handleRegisterSuccess} />
        )}
      </div>

      {/* Success Popup */}
      {showPopup && (
        <div className="absolute bottom-10 p-4 text-white bg-green-500 rounded-lg shadow-lg">
          Registered successfully!
        </div>
      )}
    </div>
  );
};

// Login Form Component
const LoginForm = ({ setIsLogin }) => (
  <form>
    <div className="mb-4">
      <label className="block text-gray-700">User Name</label>
      <input
        type="text"
        placeholder="Enter User Name"
        className="w-full px-3 py-2 mt-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
      />
    </div>
    <div className="mb-4">
      <label className="block text-gray-700">Password</label>
      <input
        type="password"
        placeholder="Enter Password"
        className="w-full px-3 py-2 mt-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
      />
    </div>
    <button className="w-full py-2 mt-4 text-white bg-blue-500 rounded-lg hover:bg-blue-600">
      Login
    </button>

    <div className="mt-4 text-center">
      <span className="text-gray-600">Don't have an account? </span>
      <button
        onClick={() => setIsLogin(false)}
        className="font-semibold text-blue-500 hover:underline"
      >
        Register
      </button>
    </div>
  </form>
);

// Register Form Component
const RegisterForm = ({ handleRegisterSuccess }) => (
  <form onSubmit={(e) => {
    e.preventDefault();
    handleRegisterSuccess(); // Trigger success popup on submit
  }}>
    <div className="mb-4">
      <label className="block text-gray-700">User Name</label>
      <input
        type="text"
        placeholder="Enter User Name"
        className="w-full px-3 py-2 mt-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
      />
    </div>
    <div className="mb-4">
      <label className="block text-gray-700">Password</label>
      <input
        type="password"
        placeholder="Enter Password"
        className="w-full px-3 py-2 mt-2 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
      />
    </div>
    <button type="submit" className="w-full py-2 mt-4 text-white bg-blue-500 rounded-lg hover:bg-blue-600">
      Register
    </button>
  </form>
);

export default Register;
